import React, { Component } from "react";

class Tasks extends Component {
  render() {
      const{tasks}=this.props
    return (
        <React.Fragment>
            {tasks.map((task)=>{
      return <div name='Tasks' key={task.id} style={{height:'24px'}}>
        {task.content}
      </div>
            })
  }
      </React.Fragment>
    );
  }
}

export default Tasks;
